import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <nav className="navBar">
      <Link to="/">
        <img
          src="https://toppng.com/uploads/preview/logo-designing-for-house-of-tshirts-online-shopping-logo-desi-11563314444xvpv60fw8y.png"
          alt="error"
          className="navBar__logo"
        />
      </Link>
    </nav>
  );
}

export default Navbar;
